import "./styles.css";

const Footer = () => {
  return (
    <footer className="footer">
      <p>&copy; 2024 Foodies Hub. All rights reserved.</p>
      <div>
        <a href="#facebook">Facebook</a> | <a href="#instagram">Instagram</a>
      </div>
    </footer>
  );
};

export default Footer;
